import React, {FC} from 'react';
import {Card, CardActions, Container, CardContent, Typography, Button, Avatar, Grid} from '@mui/material';
import { deepOrange, deepPurple } from '@mui/material/colors';

import {TeamMember} from "../BoxPreview";

interface BoxTeamProps {
    leader?: string;
    members?: TeamMember[],
    title: string;
    total?: number;
}
export const BoxTeamPreview: FC<BoxTeamProps> = ({ leader, members, title, total }) => {
    return (
        <Container>
            <Card>
                <CardContent>
                    <Typography variant="h2" color="text.secondary" gutterBottom textAlign='left'>
                        {title}
                    </Typography>
                    <Typography variant="h3" textAlign='left' component="div" gutterBottom>
                        Лидер: {leader}
                    </Typography>
                    <Typography variant="h3" component="div">
                        Количество человек: {total}
                    </Typography>

                    <Grid container spacing={2} direction='reverse'>
                        {members?.length && members.map(({lastName, firstName, id}) => (
                            <Grid item key={id} style={{ display: 'flex'}}>
                                <Avatar sx={{ bgcolor: deepOrange[500], width: 56, height: 56 }}>{lastName[0]}{firstName[0]}</Avatar>
                            </Grid>
                        ))}
                   </Grid>
                </CardContent>
                <CardActions>
                    <Button size="small">Подробнее</Button>
                </CardActions>
            </Card>
        </Container>
    );
}
